import React from 'react';
import './index.scss';
import Error from '../error';
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";


function Page() {
  return (

 <div>


<Switch>


<Route path="/">
<div> Home Sweet Home</div>
</Route>

<Route path="/about">
<div>About Us</div>
</Route>
<Route path="/projects">
<div>About our Projects</div>
</Route>

<Route path="*">
        <Error/>
</Route>
  </Switch>

 </div>


  )
}

export default Page;
